import { Card } from 'flowbite-react';
import React from 'react';

const UserCard = () => {
    const img = "https://scontent.fsgn3-1.fna.fbcdn.net/v/t39.30808-1/350118519_479477941022130_6544855667418265188_n.jpg?stp=dst-jpg_s320x320&_nc_cat=111&ccb=1-7&_nc_sid=2b6aad&_nc_ohc=i3JyyOmw0B0AX9xslvR&_nc_ht=scontent.fsgn3-1.fna&oh=00_AfBYMGvrA3cGTvfGGX_oUXHZRnPQS2sQipFFKhar9TLx9w&oe=64E0EB9D"

    return (
        <div className="bg-white rounded-md p-4 flex flex-col items-center">
            <div>
                <img src={img} alt="avatar" className="h-20 rounded-full"/>
            </div>
            <div id="title" className="font-bold text- mt-2">Nguyễn Kim Bảo Ngân</div>
            <div id="stats" className="flex justify-between items-center my-4">
                <div className="flex flex-col items-center mr-5">
                    <div className="font-bold">172</div>
                    <div className="">Bài viết</div>
                </div>
                <div className="flex flex-col items-center">
                    <div className="font-bold">45</div>
                    <div className="">Người theo dõi</div>
                </div>
            </div>
            <div id="status">title</div>
            <div id="actions">actions</div>

        </div>
    );
};

export default UserCard;
